Busted is an album by Cheap Trick, which was released in 1990 and peaked at #44 on the US album charts. After the success of &quot;The Flame&quot; from the previous album Lap of Luxury, the band recorded Busted with a similar format, especially on the single &quot;Can't Stop Fallin' Into Love.&quot; The single peaked at #12 on the US charts. The album failed to be as successful as the label had hoped, and about a year after the release of Busted  Epic Records dropped Cheap Trick from their label. There were three videos shot for this LP; &quot;Can't Stop Fallin' Into Love,&quot; &quot;If You Need Me,&quot; and &quot;Wherever Would I Be.&quot;

Physical copies of the album have been out of print for several years (with the exception of Japan), but it will be reissued in 2010 in the US along with the previous album Lap of Luxury in a 2-CD set.

Cheap Trick is an American rock  band from Rockford, Illinois, formed in 1974. The band consists of members Robin Zander (lead vocals, rhythm guitar), Rick Nielsen (lead guitar, backing vocals), Tom Petersson (electric bass, backing vocals), and Bun E. Carlos (drums, percussion).

Cheap Trick created a substantial fan base through its own brand of power pop music with a hard-edged yet melodic pop sound that combined the catchiness of The Beatles with the speed and energy of punk rock. The Los Angeles Times has remarked that &quot;Cheap Trick gained fame by twisting the Beatlesque into something shinier, harder, more American.&quot; Their biggest hits include &quot;Surrender&quot;, &quot;I Want You to Want Me&quot;, &quot;Dream Police&quot;, and &quot;The Flame&quot;. Cheap Trick also performed a cover version of Big Star's &quot;In the Street&quot; as the theme song for That '70s Show from the second season onward and the theme song &quot;Baby Muggles&quot; for The Colbert Report.

As of 2009[update], Cheap Trick continues to tour with their most well known lineup. They have often been referred to in the Japanese press as the &quot;American Beatles&quot;. The Illinois State Senate has declared April 1 to be &quot;Cheap Trick Day&quot; in the State. The band was also ranked #25 in VH1's list of the 100 Greatest Artists of Hard Rock.


